macro_rules! push_all {
    ($result:expr; $($val:expr),*) => {
        {
            $(
                $result.push($val);
            )*
        }
    };
}

pub fn get_factorization() -> Vec<RingElWrapper<PolyRing<F10201Type>>> {
    let ring = F10201.bind_ring_by_value();
    let poly_ring = PolyRing::adjoint(F10201.clone(), "x").bind_ring_by_value();
    let x = poly_ring.from(poly_ring.wrapped_ring().unknown());
    let i = z_hom(&poly_ring);
    let a = poly_ring.embed(&ring, ring.from(F10201.generator()));
    let mut result = Vec::new();
    
    push_first_part(&mut result, &i, &a, &x);
    push_second_part(&mut result, &i, &a, &x);
    return result;
}

